import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import UsuarioList from './components/usuario/UsuarioList';
import LibroList from './components/libro/LibroList';
import ReservaList from './components/reserva/ReservaList';
import PrestamoList from './components/prestamo/PrestamoList';
import RolList from './components/rol/RolList';

export default function App() {
  return (
    <BrowserRouter>
      <div>
        <h2>Frontend minimal - APIs</h2>
        <div className="nav">
          <Link to="/usuario">Usuarios</Link> |
          <Link to="/libro">Libros</Link> |
          <Link to="/reserva">Reservas</Link> |
          <Link to="/prestamo">Pr√©stamos</Link> |
          <Link to="/rol">Roles</Link>
        </div>

        <Routes>
          <Route path="/usuario" element={<UsuarioList />} />
          <Route path="/libro" element={<LibroList />} />
          <Route path="/reserva" element={<ReservaList />} />
          <Route path="/prestamo" element={<PrestamoList />} />
          <Route path="/rol" element={<RolList />} />
          <Route path="/" element={<div>Selecciona un recurso arriba</div>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
